package writer_test

import (
	"testing"

	"github.com/3JoB/ulib/fsutil"
	"github.com/3JoB/ulib/fsutil/writer"
)

func Benchmark_Ulib_Write(b *testing.B) {
	b.ResetTimer()
	for i := 0; i < b.N; i++ {
		fsutil.Write("test.ulib.io", `

`)
	}
	fsutil.Remove("test.ulib.io")
}

func Benchmark_UlibWriter_Write(b *testing.B) {
	b.ResetTimer()
	w, _ := writer.NewWriter("test.ulibw.io")
	for i := 0; i < b.N; i++ {
		w.Add(`

`)
	}
	w.Close()
	fsutil.Remove("test.ulibw.io")
}

func Benchmark_UlibWriter_Strings_Write(b *testing.B) {
	b.ResetTimer()
	w, _ := writer.NewWriter("test.ulibws.io")
	for i := 0; i < b.N; i++ {
		w.AddString(`

`)
	}
	w.Close()
	fsutil.Remove("test.ulibws.io")
}

func Benchmark_UlibWriter_MaxBuffer_Strings_Write(b *testing.B) {
	b.ResetTimer()
	w, _ := writer.NewWriter("test.ulibws.io")
	w.MaxBuffer(10240)
	for i := 0; i < b.N; i++ {
		w.AddString(`

`)
	}
	w.Close()
	fsutil.Remove("test.ulibws.io")
}

func Benchmark_Basic_Write(b *testing.B) {
	b.ResetTimer()
	f, _ := fsutil.Open("test.basic.io")
	for i := 0; i < b.N; i++ {
		f.Write([]byte(`

`))
	}
	f.Close()
	fsutil.Remove("test.basic.io")
}
